tyle=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;title:title,<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;opacity : 0.3,<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;cache:false,<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;ok: function(){<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; iframe = this.iframe.contentWindow;<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;saveObj();<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;return false;<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;},<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;cancelVal: &#39;关闭&#39;,<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;cancel: true /*为true等价于function(){}*/<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp; })</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p><p><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">6.&nbsp;&nbsp;列表自定义查询条件问题</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;jeecg默认生成的查询条件，布局如果满足不了需求可以自定义查询条件</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color:#000000;word-wrap: break-word; font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"word-wrap: break-word; background-color: yellow;\"><span style=\"word-wrap: break-word; font-weight: 700;\">说明：命名规则按照datarid的name进行命名，参考下面规则，js方法会自动生成</span></span></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;</span></p><table cellspacing=\"0\" class=\"t_table\" width=\"377\"><tbody style=\"word-wrap: break-word;\"><tr style=\"word-wrap: break-word;\" class=\"firstRow\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">t:datagrid</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">name = {<span style=\"word-wrap: break-word; font-weight: 700;\">userList2</span>}</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">查询域div</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">id={<span style=\"word-wrap: break-word; font-weight: 700;\">userList2</span>}tb</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">查询对应JS方法</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">{<span style=\"word-wrap: break-word; font-weight: 700;\">userList2</span>}search();</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">重置对应JS方法</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">searchReset(&#39;{<span style=\"word-wrap: break-word; font-weight: 700;\">userList2</span>}&#39;);</td></tr></tbody></table><p><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;参考代码：src/main/webapp/webpage/system/user/userList2.jsp</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;参考demo如下：</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><ignore_js_op style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Ta