Q图片20160705113144.png\" lazyloaded=\"true\" _load=\"1\" style=\"word-wrap: break-word; cursor: pointer;\"/>&nbsp;</ignore_js_op><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">26.JEECG兼容那些浏览器，是否兼容IE?</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp; &nbsp;jeecg兼容所有的浏览器 IE、谷歌、火狐等浏览器都支持。</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp; &nbsp;jeecg的首页和登录页面分很多套：登录页面有三套，首页有5套</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp;&nbsp;</span><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp;五套首页IE支持情况，菜单三级支持情况列表：</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><table cellspacing=\"0\" class=\"t_table\" width=\"377\"><tbody style=\"word-wrap: break-word;\"><tr style=\"word-wrap: break-word;\" class=\"firstRow\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\"><span style=\"word-wrap: break-word; font-weight: 700;\">首页风格</span></td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\"><span style=\"word-wrap: break-word; font-weight: 700;\">IE兼容性</span></td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\"><span style=\"word-wrap: break-word; font-weight: 700;\">菜单支持三级</span></td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">ACE平面风格</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">支持IE10+</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">不支持</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">ShortCut风格</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">支持IE6+</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">支持</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">经典风格</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">支持IE6+</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">支持</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">Sliding云桌面</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">支持IE8+</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">&nbsp;&nbsp;不支持</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">H+平面风格</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">支持IE10+</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">&nbsp;&nbsp;不支持</td></tr></tbody></table><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">27. 最新版本（</span><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">3.6.4</span><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">）登录后首页乱码&nbsp; &nbsp;</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;</span><ignore_js_op style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><img id=\"aimg_1809\" aid=\"1809\" src=\"http://www.jeecg.org/data/attachment/forum/201607/06/170208i9poee0ej0p80jvs.png\" zoomfile=\"data/attachment/forum/201607/06/170208i9poee0ej0p80jvs.png\" file=\"data/attachment/forum/201607/06/170208i9poee0ej0p80jvs.png\" class=\"zoom\" width=\"600\" inpost=\"1\" alt=\"QQ图片20160706170430.png\" title=\"QQ图片20160706170430.png\" lazyloaded=\"true\" _load=\"1\" style=\"word-wrap: break-word; cursor: pointer;\"/>&nbsp;</ignore_js_op><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; 解决办法：&nbsp;</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; 1.浏览器兼容问题，建议谷歌浏览器</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; 2. 底层jar是旧的，更新jeecg maven依赖，特别是snapshot类型的，更新后会解决该问题，如果不熟悉maven可以下载官方提供本地仓库&nbsp;</span><a href=\"http://git.oschina.net/jeecg/jeecg-local-maven\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">http://git.oschina.net/jeecg/jeecg-local-maven</a><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">28.jeecg的数据表 必须得有id这个字段么？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp;&nbsp;不是，jeecg的实体必须是id，数据库主键通过注解与实体映射即可。</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"